svg:svg.svg:script:
function changebg(evt) {
    var thePath             = evt.target;
    var theGroup            = thePath.parentNode;
    var theLayer1           = theGroup.parentNode;
    for (childIndex in theLayer1.children)
    {
        var theChild        = theLayer1.children[childIndex];
        if (theChild.tagName != 'svg:g')
        {
            continue;
        }
        var theSubpath          = theChild.children[1];
        theSubpath.style.fill   = '#FFF';
        var theFact             = theChild.children[2];
        theFact.style.visibility   = 'hidden';
        for (var i = 0; i < theFact.children.length; i++)
        {
            theFact.children[i].style.visibility    = 'hidden';
        }
    }

    thePath.style.fill          ='#555';
    var theInfo                 = theGroup.children[2];
    theInfo.style.visibility    = 'visible';
    for (var i = 0; i < theInfo.children.length; i++)
    {
        theInfo.children[i].style.visibility    = 'visible';
    }
}
